Heres a focused review at 325px width. Ill call out issues and give concrete fixes. I dont have your exact class names, so Im using reasonable selectorsswap to your actual ones.

---

##  1) Layout overflow
**Issue:** The OFFHAND / PRIMARY badges in weapon cards look tight and can wrap into 2 lines (e.g., OFFHAND). That risks **badge height expanding** and squeezing content.

**Fix:**
```css
.weapon-card .badge {
  white-space: nowrap;
  font-size: 12px;
  padding: 6px 10px;
  line-height: 1.1;
}
```

**Issue:** Long option text (e.g., Modern firepower  M1899 or Mauser) is wrapping into 23 lines and the button height is inconsistent.

**Fix:**
```css
.quick-option {
  display: block;
  width: 100%;
  text-align: left;
  white-space: normal;
}
```

---

##  2) Touch targets (44px min)
**Issue:** The Back to Weapons link at top is small and not a 44px tap target.

**Fix:**
```css
.back-link {
  display: inline-flex;
  align-items: center;
  min-height: 44px;
  padding: 8px 0;
  font-size: 16px;
}
```

**Issue:** Quick option buttons appear shortsome look <44px height.

**Fix:**
```css
.quick-option {
  min-height: 44px;
  padding: 12px 14px;
  font-size: 15px;
}
```

---

##  3) Text readability
**Issue:** Body helper text and e.g. input hint look small and low contrast.

**Fix:**
```css
.helper-text, .input-hint {
  font-size: 15px;
  color: rgba(255,255,255,0.75);
  line-height: 1.5;
}
```

**Issue:** Stat labels in weapon cards (DAMAGE, RANGE) are borderline small.

**Fix:**
```css
.stat-label {
  font-size: 12px;
  letter-spacing: 0.6px;
}
.stat-value {
  font-size: 16px;
}
```

---

##  4) Navigation buttons (Back / Next)
**Issue:** Back button looks disabled and is visually low priority. Its also close to the Next button, which risks accidental taps.

**Fix (spacing + size):**
```css
.wizard-nav {
  display: grid;
  gap: 12px;
}
.wizard-nav .btn {
  min-height: 48px;
  font-size: 16px;
}
```

**Optional:** Make Back secondary but still visible:
```css
.btn-back {
  opacity: 0.8;
  border: 1px solid rgba(255,255,255,0.2);
}
```

---

##  5) Quick option buttons
**Issue:** The option buttons stack well but their **padding is small** and text feels cramped.

**Fix:**
```css
.quick-option {
  padding: 12px 14px;
  border-radius: 10px;
  line-height: 1.35;
}
```

---

##  6) Weapon cards (results)
**Issue:** Stat tiles are readable but tight. On 325px the 3column grid is narrow, and numbers + arrows are cramped.

**Fix:**
```css
.weapon-stats {
  grid-template-columns: repeat(2, 1fr);
  gap: 8px;
}
.stat-tile {
  padding: 10px;
}
```

This makes stats easier to scan on small screens.

**Issue:** Why callout is a big blockhard to scan.

**Fix:**
```css
.why-box {
  font-size: 15px;
  line-height: 1.5;
  padding: 12px;
}
```

---

##  7) Chat bubble / AI response formatting
**Issue:** The How This Loadout Works paragraph is long and dense on a tiny screen. It needs chunking.

**Fix:**
```css
.ai-response p {
  margin-bottom: 12px;
  font-size: 16px;
  line-height: 1.6;
}
.ai-response ul {
  padding-left: 18px;
  margin-top: 8px;
}
```

Also consider splitting into bullet points (especially for weapon roles).

---

### Quick wins summary (most impactful)
1. Increase **touch targets** for quick options + back link.
2. Switch **stat grid** to 2 columns on 325px.
3. Prevent **badge wrapping** (OFFHAND).
4. Increase helper text size/contrast.

If you share actual selectors, I can give precise CSS patches.
